    };
  }



  render() {

    return (
      <div>
        <nav className="navbar bg-light " >         
            <div >
              <ul className="navbar-nav mr-auto">

                <li>
                  <Link>Dashboard</Link>
                </li>
                <li>
                  <Link >Permissions</Link>
                </li>
              </ul>
            </div>
        </nav>
      </div>
    );
  }
}
